    false,nt"url": null,nt"notes": "This dataset is comprised of 10 aerial
    images of three different study areas on Alaska's Arctic Coastal Plain flown by
    NASA in 1974, 1977, 1979 and obtained from the USGS EROS Data Center via the EarthExplorer
